// Update updates Txn fields by primary key
func (o *Txn) Update(db *gorm.DB, fields ...txnDBSchemaField) error {
	dbNameToFieldName := map[string]interface{}{
		"id":              o.ID,
		"created_at":      o.CreatedAt,
		"updated_at":      o.UpdatedAt,
		"deleted_at":      o.DeletedAt,
		"qiwi_txn_id":     o.QiwiTxnID,
		"txn_type":        o.TxnType,
		"provider_id":     o.ProviderID,
		"amount":          o.Amount,
		"qiwi_created_at": o.QiwiCreatedAt,
		"fee":             o.Fee,
		"status":          o.Status,
		"wallet_id":       o.WalletID,
	}
	u := map[string]interface{}{}
	for _, f := range fields {
		fs := string(f)
		u[fs] = dbNameToFieldName[fs]
	}
	if err := db.Model(o).Updates(u).Error; err != nil {
		if err == gorm.ErrRecordNotFound {
			return err
		}

		return fmt.Errorf("can't update Txn %v fields %v: %s",
			o, fields, err)
	}

	return nil
}

